import React, { useState } from 'react';
import { Link as RouterLink } from 'react-router-dom';
import {
  AppBar, Toolbar, Typography, Button, IconButton, Box, Menu, MenuItem,
  Badge, Drawer, List, ListItem, ListItemText, ListItemIcon, Divider,
  Avatar, useMediaQuery
} from '@mui/material';
import { useTheme } from '@mui/material/styles';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import RestaurantIcon from '@mui/icons-material/Restaurant';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import FavoriteIcon from '@mui/icons-material/Favorite';
import HistoryIcon from '@mui/icons-material/History';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import { useUser } from '../context/UserContext';

const Header = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));
  const [menuAnchor, setMenuAnchor] = useState(null);
  const [drawerOpen, setDrawerOpen] = useState(false);
  const { user, orders } = useUser();

  const handleMenuOpen = (event) => {
    setMenuAnchor(event.currentTarget);
  };

  const handleMenuClose = () => {
    setMenuAnchor(null);
  };

  const toggleDrawer = (open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }
    setDrawerOpen(open);
  };

  return (
    <>
      <AppBar position="static" color="default" elevation={1}>
        <Toolbar>
          {isMobile && (
            <IconButton
              edge="start"
              color="inherit"
              aria-label="menu"
              onClick={toggleDrawer(true)}
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
          )}

          <Typography 
            variant="h6" 
            component={RouterLink} 
            to="/"
            sx={{ 
              flexGrow: 1, 
              textDecoration: 'none', 
              color: 'inherit',
              display: 'flex',
              alignItems: 'center'
            }}
          >
            <RestaurantIcon sx={{ mr: 1 }} />
            FoodExpress
          </Typography>

          {!isMobile && (
            <Box sx={{ display: 'flex' }}>
              <Button color="inherit" component={RouterLink} to="/">
                Restaurants
              </Button>
              {user && (
                <>
                  <Button color="inherit" component={RouterLink} to="/favorites">
                    <FavoriteIcon sx={{ mr: 0.5 }} />
                    Favorites
                  </Button>
                  <Button color="inherit" component={RouterLink} to="/orders">
                    <Badge badgeContent={orders.length} color="error">
                      <HistoryIcon sx={{ mr: 0.5 }} />
                    </Badge>
                    Orders
                  </Button>
                </>
              )}
            </Box>
          )}

          <Box>
            <IconButton
              aria-label="account of current user"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleMenuOpen}
              color="inherit"
            >
              {user ? (
                <Avatar alt={user.name} src={user.photo} sx={{ width: 32, height: 32 }} />
              ) : (
                <AccountCircleIcon />
              )}
            </IconButton>
            <Menu
              id="menu-appbar"
              anchorEl={menuAnchor}
              anchorOrigin={{
                vertical: 'bottom',
                horizontal: 'right',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              open={Boolean(menuAnchor)}
              onClose={handleMenuClose}
            >
              {user ? (
                [
                  <MenuItem key="profile" component={RouterLink} to="/profile" onClick={handleMenuClose}>
                    My Profile
                  </MenuItem>,
                  <MenuItem key="addresses" component={RouterLink} to="/addresses" onClick={handleMenuClose}>
                    My Addresses
                  </MenuItem>,
                  <MenuItem key="logout" onClick={handleMenuClose}>
                    Logout
                  </MenuItem>
                ]
              ) : (
                [
                  <MenuItem key="login" component={RouterLink} to="/login" onClick={handleMenuClose}>
                    Login
                  </MenuItem>,
                  <MenuItem key="signup" component={RouterLink} to="/signup" onClick={handleMenuClose}>
                    Sign Up
                  </MenuItem>
                ]
              )}
            </Menu>
          </Box>
        </Toolbar>
      </AppBar>

      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={toggleDrawer(false)}
      >
        <Box
          sx={{ width: 250 }}
          role="presentation"
          onClick={toggleDrawer(false)}
          onKeyDown={toggleDrawer(false)}
        >
          <List>
            <ListItem button component={RouterLink} to="/">
              <ListItemIcon>
                <RestaurantIcon />
              </ListItemIcon>
              <ListItemText primary="Restaurants" />
            </ListItem>

            {user && (
              <>
                <ListItem button component={RouterLink} to="/favorites">
                  <ListItemIcon>
                    <FavoriteIcon />
                  </ListItemIcon>
                  <ListItemText primary="Favorites" />
                </ListItem>

                <ListItem button component={RouterLink} to="/orders">
                  <ListItemIcon>
                    <Badge badgeContent={orders.length} color="error">
                      <HistoryIcon />
                    </Badge>
                  </ListItemIcon>
                  <ListItemText primary="Orders" />
                </ListItem>

                <ListItem button component={RouterLink} to="/addresses">
                  <ListItemIcon>
                    <LocationOnIcon />
                  </ListItemIcon>
                  <ListItemText primary="My Addresses" />
                </ListItem>
              </>
            )}
          </List>

          <Divider />

          <List>
            {user ? (
              <>
                <ListItem button component={RouterLink} to="/profile">
                  <ListItemIcon>
                    <AccountCircleIcon />
                  </ListItemIcon>
                  <ListItemText primary="My Profile" />
                </ListItem>

                <ListItem button>
                  <ListItemIcon>
                    <ExitToAppIcon />
                  </ListItemIcon>
                  <ListItemText primary="Logout" />
                </ListItem>
              </>
            ) : (
              <>
                <ListItem button component={RouterLink} to="/login">
                  <ListItemIcon>
                    <AccountCircleIcon />
                  </ListItemIcon>
                  <ListItemText primary="Login" />
                </ListItem>

                <ListItem button component={RouterLink} to="/signup">
                  <ListItemIcon>
                    <PersonAddIcon />
                  </ListItemIcon>
                  <ListItemText primary="Sign Up" />
                </ListItem>
              </>
            )}
          </List>
        </Box>
      </Drawer>
    </>
  );
};

export default Header;
